## Proposal

### Please re-state the problem that we are trying to solve in this issue.
When an expense is moved from one workspace report to another, and the original report is deleted, the system currently displays two messages:
- The correct message: "Moved this expense to Expense Report XX"
- An incorrect message: "Moved this expense to your personal space"

This is confusing for users, as the expense was not moved to personal space, but to another workspace report.

### What is the root cause of that problem?
The code previously always added an `UNREPORTED_TRANSACTION` system message in [`src/libs/actions/Report.ts`](https://github.com/Expensify/App/blob/main/src/libs/actions/Report.ts#L4718) when deleting a report, regardless of whether the expense was being moved to another workspace report or to personal space. This was due to the lack of a conditional check on the destination of the moved expense, resulting in both messages being shown.

### What changes do you think we should make in order to solve the problem?
Update the logic in [`src/libs/actions/Report.ts`](https://github.com/Expensify/App/blob/main/src/libs/actions/Report.ts#L4718)  so that the `UNREPORTED_TRANSACTION` system message is only added if the expense is actually being moved to personal space (unreported). This is done by checking if the target report is a personal space before adding the action. If the expense is moved to another workspace report, only the correct message ("Moved this expense to Expense Report XX") will be shown.

